import React from 'react';
import Header from './components/Header';
import Home from './components/Home';
import About from './components/About'; 
import Solutions from './components/Solutions'; 
import ContactUs from './components/Contact'; 
import ChargeLocator from './components/ChargeLocator'; 
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';


const App = () => {
  return (
    <Router>
      <div className="app">
        <Header />
        <Routes>
        <Route path="/" exact element={<Home />} />
          <Route path="/about" element={<AboutUs />} />
          <Route path="/solutions" element={<Solutions />} />
          <Route path="/carcharge" element={<CarCharge />} />
          <Route path="/buscharge" element={<BusCharge />} />
          <Route path="/truckcharge" element={<TruckCharge />} />
          <Route path="/charger-locator" element={<ChargerLocator />} />
          <Route path="/contact" element={<ContactUs />} />
          {/* <Route path="/" exact component={Home} />
